const ProfileForm = () => {
  return (
    <form className="{classes.form}">
      <div className="{classes.control}">
        <label htmlFor='new-password'>New Password</label>
        <input className="bg-red-100" type='password' id='new-password' />
      </div>
      <div className="{classes.action} ">
        <button className="bg-red-900 text-white p-2 border">Change Password</button>
      </div>
    </form>
  );
}

export default ProfileForm;
